import React from 'react';

class MainPage extends React.Component {
    render() {
        return (
                <div className="page main">
                <div className="main-title">Zakopane Accomodation</div>
                <div className="main-description">
                    You also thing that our mountains are beautiful want to spend amaizing vacations in Zakopane? 
                    Looking for an apartament near Zakopane. Check our wide range of houses and rooms  
                </div>

                </div>
        );
    };
};

export default MainPage;
